window.bookSummaryJSON = "<p>Nine of us came here. We look like you. We talk like you. We live among you. But we are not you. We can do things you dream of doing. We have powers you dream of having. We are stronger and faster than anything you have ever seen. We are the superheroes you worship in movies and comic books but we are real.</p> <p>Our plan was to grow, and train, and become strong, and become one, and fight them. But they found us and started hunting us first. Now all of us are running. Spending our lives in shadows, in places where no one would look, blending in. we have lived among you without you knowing.</p> <p>But <i>they</i> know.</p> <p>They caught Number One in Malaysia.<br>Number Two in England.<br>And Number Three in Kenya.<br>They killed them all.</p> <p>I am Number Four.</p> <p>I am next.</p> <p>Also included is a sneak listen to the first chapter of the next book in the series. Enjoy!</p>"; 
